import React, { Component } from "react";
import PageHeader from "../components/pageHeader";
import PageSidebar from "../components/pageSidebar";

class PageContent extends Component {
  render() {
    return (
      <div>
        {/* Header */}
        <PageHeader />
        {/* Sidebar */}
        <PageSidebar />
        {/* Content */}
      </div>
    );
  }
}

export default PageContent;
